import React, {useState,useEffect} from 'react';
import './App.css';

const App = () => {
  const [courses, setCourses] = useState<any[]>([]);

  useEffect(() => {
    fetch('http://localhost:3000/courses')
      .then(res => res.json())
      .then(courses => {
        console.log(courses);
        setCourses(courses);
      });
  },[]);

  return (
    <div className="App">
      <ul>
      {courses.map((item) => (
        <li key={item.id}>{item.number} - {item.title}</li>
      ))}
      </ul>
    </div>
  );
}
